                <div>
                <Card  style={{backgroundColor: 'white', height: '100%'}} >
                  <Col span={24} style={{textAlign: 'center'}}>
                    <Row >
                      <p style={{fontSize: 46, lineHeight: 0.8}}>Water management simplified</p>
                    </Row>
                    <Row>
                      <p style={{fontSize: 22, lineHeight: 1}}><b style={{color: 'black' }}>The easiest-to-use water quality and water infrastructure asset manager software.</b></p>
                    </Row>
                    <Row>
                    <p style={{fontSize: '15px'}}>AquaSource helps you manage multiple projects, in one place, with ultimate project visibility.</p>


                  </Row>
                  </Col>

                </Card>
                </div>
                </Row>

                <Row justify="center" style={{paddingTop: 3}}>
                        <div>
                        <Card  style={{backgroundColor: '#f6f6f6', height: '100%'}} >
                          <Col span={3}>

